  true,\n\t\"url\": null,\n\t\"notes\": \"Pipeline Safety - Pipeline and liquefied
  natural gas (LNG) facility operators must submit a Safety Related Condition Report
  if certain kinds of conditions are discovered on a pipeline facility. A list of
  the conditions can be found in Part 191.23 and Part 195.55.  The operator is required
  to submit the information to PHMSA if the company has not resolved the condition
  within five business days of determining the condition exists. This reporting requirement
  applies only to conditions that might impact a building intended for human occupancy,
  outdoor place of assembly, public road or railroad.\",\n\t\"license_title\": \"U.S.
